import React from 'react';

export default class KalenderPopup extends React.Component {
    render() {
        return(
            <>
            <button onClick={this.props.closePopup}>close me</button>
            <ul id = "popupList">
                <li>test: 1</li>
                <li>bla:blub</li>
            </ul>
            </>
        );
    }
}
